Defendant Daniel P Heiden in court, in custody, with attorney Kevin G Keane.   Mary C. Brejcha appeared for the State of Wisconsin.

The Court Orders the Following:

Imposed Sentence of:

8 years Imprisonment (Credit - 218 days )
- 3 years of Initial Confinement
- 5 years of Extended Supervision

Conditions of Extended Supervision:
- AODA Assessment and follow through with any treatment recommended;
- Mental Health Evaluation and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- No unsupervised contct with anyone under the age of 18 without prior agent approval;
- No possession or use of a computer or any device capable of accessing the internet without prior agent approval;
- No possession of any pornographic/sexually explicit materials;
- Complaince with the sex offender registry program;
- Compliance with the sex offender programming and recommendations;
- Compliance in any treatment program as recommended;
- Perform  30 hours of community service each year of extended supervision with the last 30 hours be completed by the 10 month of the last year;
- Maintain/Obtain full time employment and/or activity;
- Provide DNA sample if not yet provided  and pay surcharge.
- Forfeiture of computers seized by Waukesha Police Department listed in police report inventory.

Image Surcharge: $500.00 
Costs: $268.00 
DNA Surcharge:  $250.00
(To be paid as a condition of extended sueprvision at the rate of $50.00  per month commencing the 1st day of the fourth month of extended supervision. )

Defendant is  eligible for the Challenge Incarceration Program
Defendant is  eligible for the Substance Abuse Program
